}


void Transpose(int**& arr, int& lines, int& cols) {
    int** temp = new int* [cols];
    for (int i = 0; i < cols; i++) {
        temp[i] = new int[lines];
        for (int j = 0; j < lines; j++) {
            temp[i][j] = arr[j][i];
        }
    }
    for (int i = 0; i < lines; i++) {
        delete[] arr[i];
    }
    delete[] arr;
    arr = temp;
    int buf = lines;
    lines = cols;
    cols = buf;
}

int main() {

