    int** arr = new int* [lines];

    for (int i = 0; i < lines; i++) {
        arr[i] = new int[cols];
    }

    Fill(arr, lines, cols);

    Print(arr, lines, cols);

    Transpose(arr, lines, cols);

    Print(arr, lines, cols);

    for (int i = 0; i < lines; i++) {
        delete[] arr[i];
    }
    delete[] arr;

}

